//Home Page
class Home extends React.Component {
    constructor () {
        super()
        this.state = {
          page: 'HomeCarousel'
        }
      }
      render () {
        return (
          <div style={{height: '100%'}}>
            <header>
                <button className='btn-logo'><Logo /></button>
                <SearchBar />
            </header>
            <HomeCarousel />
          </div>
        )
      }
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<Home />);
